delivery-api/accessing-entries/entry-sea.body:
Search
A Query tree structure, along with order and paging specifiers, allows a search to be performed against indexed documents held in ElasticSearch. The query API allows any required sub-query structure to be defined and a comprehensive selection of Operators enable individual field level evaluation.
Queries
This example demonstrates a simple search with default ordering and paging options:
Synchronous
var query = new Query(
    Op.Contains("title", "Batman"),
    Op.GreaterThan("lengthRunTime", 200)
);

// Execute the search
var results = client.Entries.Search(query);

Asynchronous
// Execute the search asynchronously
var results = await client.Entries.SearchAsync(query);

// TODO

POST: /api/search

{
    "where": [{
        "field": "title",
        "contains": "Batman"
    }, {
        "field": "lengthRunTime",
        "greaterThan": 200
    }]
}



Sub-queries
A sub-query is a query within another query that is used as a condition to further restrict the results. Effectively they are defined by an explicit nesting of logical operators.
This example demonstrates a simple search with a sub-query:
Synchronous
var query = new Query(
    Op.Contains("title", "Batman"),
    Op.Or(
        Op.GreaterThan("yearOfRelease", 1960),
        Op.Contains("synopsis", "gotham")
    )
);

// TODO

{
    "where": [
        {
            "field": "title",
            "contains": "Batman"
        },
        {
            "or": [
                {
                    "field": "yearOfRelease",
                    "greaterThan": 1960
                },
                {
                    "field": "synopsis",
                    "contains": "gotham"
                }
            ]
        }
    ]
}



Ordering
Results can be ordered by one or more fields in an ascending or descending direction. Order clauses are prioritised in the order that they are added. By default, if no order clauses are specified then the entry results are ordered by the TitleField 1 in an ascending direction.
Order by 'yearOfRelease'.
query.OrderBy.Add("yearOfRelease")

Order by 'yearOfRelease' in a descending direction using the '-' token.
query.OrderBy.Add("-yearOfRelease")

Multiple order clauses.
query.OrderBy.Add("title", "-yearOfRelease")

// TODO

Order by 'yearOfRelease'.
{
    "orderBy": [{
        "asc": "yearOfRelease"
    }],
}

Order by 'yearOfRelease' in a descending direction using the '-' token.
{
    "orderBy": [{
        "desc": "yearOfRelease"
    },],
}

Order by 'yearOfRelease' in a descending direction using the '-' token.
{
    "orderBy": [{
        "desc": "yearOfRelease"
    },],
}



Paging
Paging allows the number of results to be restricted to a defined count so that the results are easier to handle and ensures a response is returned quickly. The page number can also be specified to allow which set of results is to be returned.
{
    // Create a query
    var query = new Query(
        Op.EqualTo("contentTypeId", "film"));

    // Set the paging options
    query.PageSize = 50; 

    // Get the 2nd result set
    query.PageIndex = 1; 
}

{
    "pageSize": 50,
    "pageIndex": 1
}




Specifying fields
System fields
The fields for search generally match the names defined in the entry structure, for example 'id', 'contentTypeId', 'projectId', etc. Field data not held at the root of the entry, such as the version information are accessed using a dot notation, i.e. 'version.versionNo', 'version.published', etc.
The 'titleField' field is a dynamic value, determined by the 'Title Field' value in the Content Type.
Data fields
Fields defined in the Content Type for the entry can be accessed by their API id.
Full example
The example below combines the ordering and paging concepts:
var query = new Query(
    Op.Contains("title", "Batman"),
    Op.GreaterThan("lengthRunTime", 200)
);

query.OrderBy.Add("-yearOfRelease")
query.PageIndex = 1;
query.PageSize = 50;

// Execute the search
var results = client.Entries.Search(query);

// TODO

POST: /api/search

{
    "pageIndex": 1,
    "pageSize": 50,
    "orderBy": [{
        "desc": "yearOfRelease"
    }],
    "where": [{
        "field": "title",
        "contains": "Batman"
    }, {
        "field": "lengthRunTime",
        "greaterThan": 200
    }]
}

delivery-api/model/http/composed-http.ht.body:
Composed fields
The composed field type contains the data that the Composer editor defines. It is an array of objects which expose type and value properties.  The type property is a name given to an allowed field type validation defined in the content type that the entry is based on. The value contains the data for the field.
An allowed field type is essentially any standard field (such as Image, Heading, Location, etc.) that restricts what types of field can be added to a composed field.
For example, an allowed field could be defined with a type of Heading and named "mainHeading" or with a type of Image and named "bannerImage". There can be multiple allowed fields based on the same type, but a composed field cannot contain other composer fields.
Properties



Name
Description




Type
The name given to a field type defined in the content type.


Value
The value of the field, which can be of any type.



Example
The JSON below shows an example composed field:
{
    "synopsis": [
        {
            "type": "mainHeading",
            "value": "Plot details"
        },
        {
            "type": "markup",
            "value": "Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah."
        },
        {
            "type": "memorableQuote",
            "value": {
                "text": "I'll be back!",
                "source": "Terminator T-800"
            }
        }
    ]
}

