common/query-operators.html.body:
Query operators
Logical Operators
And
This would return any document where first is 1 AND second is 2.
The And operator is the default logical operator and is not required to be specified explicitly.
{
    "where": [{
        "and": [{
            "field": "first",
            "equalTo": 1
        }, {
            "field": "second",
            "equalTo": 2
        }]
    }]
}

Is equivalent to:
{
    "where": [{
        "field": "first",
        "equalTo": 1
    }, {
        "field": "second",
        "equalTo": 2
    }]
}

var query = new Query(
    Op.And(
        Op.EqualTo("first", 1),
        Op.EqualTo("second", 2)
    )
);

Is equivalent to:
var query = new Query(
    Op.EqualTo("first", 1),
    Op.EqualTo("second", 2)
);




Or
The example would return any document where first is 1 OR second is 2.
{
    "where": [{
        "or": [{
            "field": "first",
            "equalTo": 1
        }, {
            "field": "second",
            "equalTo": 2
        }]
    }]
}

var query = new Query(
    Op.Or(
        Op.EqualTo("first", 1),
        Op.EqualTo("second", 2)
    )
);




Not
The not expects an inner operator so in the example any document where first is NOT equal to 7 would be returned.
{
    "where": [{
        "not": {
            "field": "first",
            "equalTo": 7
        }
    }]
}

var query = new Query(
    Op.Not(Op.EqualTo("first", 7))
);




Relational & equality operators
Between
In this example, if our field is between 18 and 45 (inclusive) it would match.
{
    "where": [{
        "field": "age",
        "between": [18, 45]
    }]
}

var query = new Query(
    Op.Between("age", 18, 45)
